import Header from './header';
import { Container, Typography } from '@material-ui/core';

export default function Layout(props) {
  return (
    <div>
      <Header></Header>
      <div>
        <Container>
          <Typography
            component="div"
            style={{ backgroundColor: '#cfe8fc', height: '100vh' }}
          >
            {props.children}
            <style jsx global>
              {`
                body: {
                  margin: 0;
                }
              `}
            </style>
          </Typography>
        </Container>
      </div>
    </div>
  );
}
